import React from 'react';
import Server from '../../models/Server';
import ServerComponent from '../serverComponent/ServerComponent';
import './serversSquares.css';

export default function ServersSquares({filteredServers} : any) {

    return (
        <div className="serversSquaresSection">
            <div className="squaresHeaderDiv">
                <h2>Servers</h2>
            </div>
            <div className="allServersSquares">
                {filteredServers.map( (server : Server, index : number) => 
                    <div key={index}>
                        <ServerComponent serverDetails={server} onOnlineStatusChange={onOnlineStatusChange} />
                    </div>
                )}
            </div>
        </div>
    )
}
